const main=document.querySelector(".data"),rowsPerBlock=10,interval=8e3,createRow=(t,e)=>t[e]?`\n\t\t\t<tr class="table-row">\n\t\t\t\t<td><div>${t[e].num||""}</div></td>\n\t\t\t\t<td><div>${t[e].initial||""}</div></td>\n\t\t\t\t<td><div>${t[e].last_name||""}</div></td>\n\t\t\t\t<td><div>${t[e].borough||""}</div></td>\n\t\t\t\t<td><div>${t[e].pr||""}</div></td>\n\t\t\t\t<td><div>${t[e].goal||""}</div></td>\n\t\t\t</tr>\n\t\t`:"",renderItems=t=>{let e=0;const d=t.length,n=Math.ceil(d/10),i=d=>{d>=n&&(d=0,e=0);let r="";for(let d=0;d<10;d++)r+=createRow(t,e),e++;main.innerHTML=r,setTimeout((()=>{i(d+1)}),8e3)};i(0)};fetch("assets/data.json").then((t=>t.json())).then((t=>{renderItems(t)}));